import React from 'react';

export const WhatIsDavida: React.FC = () => (
  <section style={{ maxWidth: 800, margin: '0 auto', padding: '48px 16px' }}>
    <h1 style={{ fontSize: '2.2rem', fontWeight: 700, marginBottom: 24, textAlign: 'center' }}>O que é Davida?</h1>
    <p style={{ fontSize: '1.2rem', lineHeight: 1.7, textAlign: 'center' }}>
      Davida é um espaço seguro e acolhedor para mulheres em todas as fases da maternidade espiritual. Nossa missão é promover acolhimento, espiritualidade, saúde emocional e conexão real, criando uma comunidade de apoio e transformação. Aqui, cada mulher encontra suporte, informação e inspiração para trilhar sua jornada com mais leveza, propósito e pertencimento.
    </p>
  </section>
);
